import style from './MainCoins.module.css'
const MainCoins = () => (
	<div className='main-coins'>
		{Array.from({ length: 5 }, (_, index) => (
			<div key={index} className='active' id={`coin-${index}`}>
				<img
					className={style.coin}
					src='../../../../assets/pictures/coins/silver/coin_front.svg'
					alt=''
				></img>
			</div>
		))}
	</div>
)

export default MainCoins
